svg.script:
const charList = '🪐 🚀 ☄ 🪐 🌟 🌛 🌜 🌞 🛰️ 👾 👽 🛸';
function load() {
	document.getElementById('te').innerHTML = randomCharacter(charList);
}

function randomCharacter(string) {
	const charArray = string.split(' ');
	const index = Math.floor(Math.random() * charArray.length);
	return charArray[index];
}
